import React, { useState } from 'react';
import './App.css';
import About from './components/About';
import Nav from './components/Nav';
import ProjectList from './components/ProjectList';
import Contact from './components/Contact';

function App() {

  const [myprojects, setProject] = useState([
    {pName: 'Study Board',
    pDescription: 'My first personal project',
    pTool: 'HTML, CSS, Javascript, React',
    pID: 1  },
    {pName: 'Tic-tac-toe Game',
    pDescription: 'A project from my study path',
    pTool: 'HTML, CSS, Javascript',
    pID: 2  },
    {pName: 'Calculator',
    pDescription: 'A project from my study path',
    pTool: 'HTML, CSS, Javascript',
    pID: 3  },
  ]);


  return (
    <div className="App">
      <About />
      <Nav />
      <ProjectList projects={myprojects}/>
      <Contact />
    </div>
  );
}

export default App;
